          "singleQuote": true,
          "trailingComma": "es5",
          "bracketSpacing": false,
          "printWidth": 120,
          "parser": "flow"
        }]
      }
    }
  ]
}

'use strict';

const argv = require('yargs').argv;
const plumber = require('gulp-plumber');
const newer = require('gulp-newer');
const babel = require('gulp-babel');
const sourcemaps = require('gulp-sourcemaps');
const log = require('fancy-log');
const gulpif = require('gulp-if');
const gulp = require('gulp');
const path = require('path');
const fs = require('fs');

const babelRc = JSON.parse(fs.readFileSync(path.join(__dirname, '.babelrc'), 'utf8'));

const ver = process.versions.node;
const majorVer = parseInt(ver.split('.')[0], 10);

const build = (lib, opts) =>
  gulp.src('src/**/*.js')
      .pipe(plumber({
        errorHandler(err) {
          log.error(err.stack);
        },
      }))
      .pipe(newer(lib))
      .pipe(gulpif(argv.sourcemaps, sourcemaps.init()))
      .pipe(babel(opts))
      .pipe(gulpif(argv.sourcemaps, sourcemaps.write('.', {sourceRoot: '../src'})))
      .pipe(gulp.dest(lib));

gulp.task('build', () =>
  build('lib', babelRc.env[majorVer >= 5 ? 'node5' : 'pre-node5'])
);

gulp.task('default', gulp.task('build'));

gulp.task(
  'watch',
  gulp.series('build', () => gulp.watch('src/**/*', gulp.task('build')))
);

// Jenkins build jobs for Yarn
// https://build.dan.cx/view/Yarn/

job('yarn-version') {
  description 'Updates the version number on the Yarn website'
  label 'linux'
  authenticationToken "${YARN_VERSION_KEY}"
  scm {
    git {
      branch 'master'
      remote {
        github 'yarnpkg/website', 'ssh'
      }
      extensions {
        // Required so we can commit to master
        // http://stackoverflow.com/a/29786580/210370
        localBranch 'master'
      }
    }
  }
  parameters {
    stringParam 'YARN_VERSION'
    booleanParam 'YARN_RC'
  }
  steps {
    shell '''
      ./scripts/set-version.sh
      git commit -m "Automated upgrade to Yarn $YARN_VERSION" _config.yml
    '''
  }
  publishers {
    git {
      branch 'origin', 'master'
      pushOnlyIfSuccess
    }
    downstreamParameterized {
      // Other jobs to run when version number is bumped
      trigger([
        'yarn-chocolatey',
        'yarn-homebrew',
      ]) {
        parameters {
          currentBuild()
        }
      }
    }
    gitHubIssueNotifier {
    }
  }
}

job('yarn-chocolatey') {
  displayName 'Yarn Chocolatey'
  description 'Ensures the Chocolatey package for Yarn is up-to-date'
  label 'windows'
  scm {
    github 'yarnpkg/yarn', 'master'
  }
  parameters {
    // Passed from yarn-version job
    stringParam 'YARN_VERSION'
    booleanParam 'YARN_RC'
  }
  steps {
    powerShell '.\\scripts\\build-chocolatey.ps1 -Publish'
  }
  publishers {
    gitHubIssueNotifier {
    }
  }
}

job('yarn-homebrew') {
  description 'Ensures the Homebrew package for Yarn is up-to-date'
  label 'linuxbrew'
  scm {
    github 'yarnpkg/yarn', 'master'
  }
  wrappers {
    credentialsBinding {
      string 'HOMEBREW_GITHUB_API_TOKEN', 'YARN_GITHUB_TOKEN'
    }
  }
  parameters {
    // Passed from yarn-version job
    stringParam 'YARN_VERSION'
    booleanParam 'YARN_RC'
  }
  steps {
    shell './scripts/update-homebrew.sh'
  }
  publishers {
    gitHubIssueNotifier {
    }
  }
}

